// Cart.js
import React from "react";

const Cart = ({ cart }) => {
    let total = 0;
    return (
        <>
            <div className="container-fluid">
                {cart.map((e, index) => (
                    <div className="row" key={e._id}>
                        <div className="col-2 m-2">{e.name}</div>
                        {total += Number(e.price)}
                        <div className="col-2 m-2">{e.price}</div>
                    </div>
                ))}
            </div>
            {total}
        </>


    );
};

export default Cart;
